-- =========================================
-- contract_ai.db (SQLite) - versioned seed (v2)
-- attributes columns kept + versionId + attributeKey
-- =========================================

PRAGMA foreign_keys = ON;

DROP TABLE IF EXISTS attribute_reviews;
DROP TABLE IF EXISTS attributes;
DROP TABLE IF EXISTS document_versions;
DROP TABLE IF EXISTS documents;

CREATE TABLE IF NOT EXISTS documents (
  id TEXT PRIMARY KEY,
  title TEXT,
  uploadedAt TEXT,
  status TEXT,
  attributeCount INTEGER,
  overallConfidence INTEGER,
  reviewedBy TEXT,
  source TEXT,
  storageRef TEXT,
  currentVersionId TEXT,
  currentVersionNumber INTEGER DEFAULT 1
);

CREATE TABLE IF NOT EXISTS document_versions (
  id TEXT PRIMARY KEY,
  documentId TEXT NOT NULL,
  versionNumber INTEGER NOT NULL,
  isLatest INTEGER NOT NULL DEFAULT 0,
  createdAt TEXT,
  createdBy TEXT,
  status TEXT,
  storageRef TEXT NOT NULL,
  notes TEXT,
  FOREIGN KEY (documentId) REFERENCES documents(id) ON DELETE CASCADE,
  UNIQUE(documentId, versionNumber)
);

-- Attributes table keeps the original columns you listed,
-- and adds versionId + attributeKey to support versioning tabs.
CREATE TABLE IF NOT EXISTS attributes (
  id TEXT PRIMARY KEY,
  documentId TEXT NOT NULL,
  name TEXT,
  category TEXT,
  section TEXT,
  page INTEGER,
  confidenceScore INTEGER,
  confidenceLevel TEXT,
  extractedValue TEXT,
  correctedValue TEXT,
  highlightedText TEXT,
  versionId TEXT NOT NULL,
  attributeKey TEXT NOT NULL,
  FOREIGN KEY (documentId) REFERENCES documents(id) ON DELETE CASCADE,
  FOREIGN KEY (versionId) REFERENCES document_versions(id) ON DELETE CASCADE,
  UNIQUE(attributeKey, versionId)
);

CREATE TABLE IF NOT EXISTS attribute_reviews (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  documentId TEXT NOT NULL,
  versionId TEXT NOT NULL,
  attributeKey TEXT NOT NULL,
  oldCorrectedValue TEXT,
  newCorrectedValue TEXT,
  reviewedBy TEXT,
  reviewedAt TEXT
);

CREATE INDEX IF NOT EXISTS idx_versions_documentId ON document_versions(documentId);
CREATE INDEX IF NOT EXISTS idx_versions_latest ON document_versions(documentId, isLatest);
CREATE INDEX IF NOT EXISTS idx_attributes_doc_ver ON attributes(documentId, versionId);
CREATE INDEX IF NOT EXISTS idx_attributes_attrKey ON attributes(attributeKey);

